CREATE TABLE `product` (
  `id` int(11) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL,
  `slug` varchar(255) DEFAULT NULL,
  `currency` varchar(3) DEFAULT NULL,
  `date_created` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  `date_modified` timestamp NULL DEFAULT CURRENT_TIMESTAMP ON UPDATE CURRENT_TIMESTAMP,
  `status` tinyint(1) unsigned DEFAULT '1',
  `featured` tinyint(1) unsigned DEFAULT '0',
  `description` text,
  `short_description` text,
  `advantages` text,
  `disadvantages` text,
  `sku` varchar(100) DEFAULT NULL,
  `price` decimal(10,2) unsigned DEFAULT NULL,
  `regular_price` decimal(10,2) unsigned DEFAULT NULL,
  `sale_price` decimal(10,2) unsigned DEFAULT NULL,
  `date_on_sale_from` datetime DEFAULT NULL,
  `date_on_sale_to` datetime DEFAULT NULL,
  `total_sales` int(11) unsigned DEFAULT NULL,
  `total_comparisons` int(11) unsigned DEFAULT NULL,
  `weight` varchar(10) DEFAULT NULL,
  `length` varchar(10) DEFAULT NULL,
  `width` varchar(10) DEFAULT NULL,
  `height` varchar(10) DEFAULT NULL,
