INSERT INTO `product` VALUES (1,'Private Krankenversicherung','private-krankenversicherung',NULL,'2018-01-10 17:05:18','2018-01-18 23:56:42',1,0,'Private Krankenversicherung Vergleich. In Deutschland muss per Gesetz jeder Mensch krankenversichert sein. Zwei Mglichkeiten stehen dafr zur Verfgung, die gesetzliche Krankenkasse oder die private Krankenversicherung. Welche Mglichkeit fr Sie die Geeignete ist und wie Sie Ihre Vorteile am besten nutzen knnen, hngt von vielen Faktoren ab.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',NULL,NULL,NULL,NULL),(2,'Zusatz-Krankenversicherung','zusatz-krankenversicherung',NULL,'2018-01-10 17:05:30','2018-01-11 00:42:54',1,0,'Notwendige Ergnzungen zur gesetzlichen Krankenversicherung\n<br><br>\nDie Leistungen der gesetzlichen Krankenversicherung werden immer weiter reduziert. Und den gesetzlich Versicherten erwarten heute stetig steigende Zuzahlungen bei Medikamenten, Krankenhausaufenthalt und Zahnersatz, sowie hhere Eigenbeteiligungen beim Arztbesuch. Mit einer privaten Zusatzversicherung knnen Sie die Leistungen der GKV sinnvoll ergnzen und somit hohe Zusatzkosten absichern.\n<br><br>\nWenn Sie als gesetzlich Versicherter sicher sein wollen, die bestmgliche Gesundheitsversorgung zu erhalten, mssen Sie sich selbst darum kmmern, Ihre Leistungen Ihren Ansprchen entsprechend zu ergnzen.\n<br><br>\nWir helfen Ihnen bei der Wahl der richtigen Lsung.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',NULL,NULL,NULL,NULL),(3,'Zahnzusatzversicherung','zahnzusatzversicherung',NULL,'2018-01-10 17:09:57','2018-01-11 00:44:10',1,0,'Kassenpatienten mssen fr Zahnersatz einen hohen Eigenanteil zahlen. Durch die private Zahnzusatzversicherung halten Sie diese Kosten niedrig. Je nach Tarif leistet die Zahnzusatzversicherung fr Brcken, Kronen, Keramikverblendungen, Inlays und sogar fr Implantate.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',NULL,NULL,NULL,NULL),(4,'Ambulante Leistung','ambulante-leistung',NULL,'2018-01-10 17:10:50','2018-01-11 00:45:31',1,0,'Als gesetzlich Versicherter muss man sich in fast allen Bereichen der gesundheitlichen Versorgung, zustzlich zum hohen Beitrag fr die Krankenkasse, an den Kosten beteiligen. Ob der Hausarzt einem ein Medikament verschreibt, oder man muss ins Krankenhaus, wenn man eine Brille bentigt, im Ausland Gesundheitsleistungen oder zu Hause alternative Heilmethoden in Anspruch nimmt.\n<br><br>\nImmer wird man als Patient zustzlich zur Kasse gebeten.\n<br><br>\nDiese versteckte Selbstbeteiligung kann man gut mit einer ergnzenden ambulanten Zusatzversicherung umgehen.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'3',NULL,NULL,NULL,NULL),(5,'Berufsunfhigkeit','berufsunfahigkeit',NULL,'2018-01-10 17:11:04','2018-01-11 00:48:18',1,0,'Nicht mehr arbeiten zu knnen bedeutet oft, wenig oder gar kein Einkommen zu haben und, wenn berhaupt, nur wenig Hilfe vom Staat zu erhalten. Wer auf Grund von Krankheit oder Unfall seinen Beruf nicht mehr ausben kann, ist vor Erreichen des gesetzlichen Renteneintrittsalters auf die staatliche Rente angewiesen. Diese zahlt jedoch nur noch allen nach 1961 Geborenen und nur bei vlliger Erwerbsminderung eine Minirente.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4',NULL,NULL,NULL,NULL),(6,'Pflegeversicherung','pflegeversicherung',NULL,'2018-01-10 17:11:18','2018-01-11 00:51:30',1,0,'Durch unsere moderne Medizin und Verbesserungen in den heutigen Lebensumstnden der Menschen werden wir immer lter. Und das ist in den meisten Fllen auch sehr schn.\n\nLeider kommt es in den anderen Fllen aber auch dazu, dass man irgendwann pflegebedrftig wird. Sei es durch Krfteverfall, einsetzende Demenz oder eine schwere Erkrankung.\n<br><br>\nUnabhngig davon, ob man dann in ein Altenpflegeheim muss oder von Angehrigen oder Profis zu Hause gepflegt werden muss. Es entstehen immense Kosten.\n<br><br>\nDie gesetzliche Pflegeversicherung trgt dann einen groen Anteil dieser Kosten. In den meisten Fllen reichen die Leistungen der gesetzlichen Pflegeversicherung jedoch nicht aus:\n\n<h4>Die folgende Tabelle zeigt die Leistungen der einzelnen Pflegegrade.</h4>\n[table]\n<br><br>\nWenn die eigene Rente dann nicht ausreicht, um die Kosten fr die Pflege zu decken, werden die Ersparnisse (Sparbcher, Wertsachen, Immobilien, etc.) aufgezehrt. Wenn auch die nicht ausreichen, werden die Angehrigen zur Kasse gebeten.\n<br><br>\nSorgen Sie fr diesen Fall vor. Mit einer Pflege-Zusatzversicherung, die diesen Fehlbetrag deckt.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4',NULL,NULL,NULL,NULL),(7,'Unfallversicherung','unfallversicherung',NULL,'2018-01-10 17:11:31','2018-01-11 01:04:01',1,0,'Unflle knnen berall und jederzeit passieren. Bei greren Verletzungen kann es danach zu starken Vernderungen im Leben kommen.\n<br><br>\nEin Unfall kann nicht nur berufliche Belastungen mit sich ziehen, auch ihre Freizeitaktivitten leiden darunter. Ihre Lebensqualitt sinkt drastisch, da der gesetzliche Schutz oft nicht ausreicht, um Sie abzusichern. Der gesetzliche Unfallschutz greift nur whrend der Arbeits- bzw. Schulzeit. 90% aller Unflle passieren jedoch im privaten Bereich. Ohne eine private Unfallversicherung sind Sie im Ernstfall unzureichend geschtzt. Die private Unfallversicherung bietet Ihnen 24 Stunden am Tag Schutz: Ob zu Hause, auf Reisen, im Beruf, in der Freizeit oder im Straenverkehr.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4',NULL,NULL,NULL,NULL),(8,'Krankentagegeld','krankentagegeld',NULL,'2018-01-10 17:11:46','2018-01-11 01:04:45',1,0,'<h4>Krankentagegeld bei Krankheitsfall</h4>\nViele Menschen sind sich heutzutage darber bewusst, dass Sie fr den Fall einer Berufsunfhigkeit vorsorgen mssen, um Einkommensverluste durch Krankheit auszugleichen.\n<br><br>\nDie Wenigsten denken jedoch darber nach, dass Sie bereits bei einer lnger andauernden Krankheit (lnger als 6 Wochen) weniger Geld im Portemonaille haben. Das Krankengeld der Krankenkasse betrgt nmlich nur ca. 70% des vorher gewohnten Einkommens.\n<br><br>\nFr eine Person, die sonst 2.000,-  fr seinen Lebensunterhalt bezieht, bedeutet das, dass Sie dann nur noch mit 1.400,-  klarkommen muss. Und das in einer Zeit, in der Zusatzkosten durch die Krankheit anfallen (teure Therapien, Medikamente, Krankenfahrten, Haushaltshilfe, etc.).\n<br><br>\nDiese Lcke (im Beispiel 600,- ) lsst sich durch ein Krankentagegeld gnstig schlieen.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'4',NULL,NULL,NULL,NULL),(9,'Private Rente','private-rente',NULL,'2018-01-10 17:12:16','2018-01-11 01:06:46',1,0,'<h4>Eine private Rentenversicherung ist so flexibel, wie Ihr Leben. Sie haben die Mglichkeit Ihre Beitrge jederzeit anzupassen oder die Art Ihrer Anlage zu wechseln.</h4>\n<br>\nIm Leben wei man nie, was alles passiert. Deshalb ist es wichtig, eine Altersvorsorge so flexibel wie mglich zu gestalten. Mit der privaten Rente haben Sie es in der Hand, ob Sie eine zeitlich begrenzte oder lebenslange Rente wnschen, oder sich bei Rentenbeginn doch fr die Kapitalauszahlung entscheiden.\n<br><br>\nMit jederzeit mglichen Zuzahlungen oder Vernderung der Beitragshhe geben Sie die Richtung Ihrer Altersvorsorge vor. Ebenso knnen Sie bei der kapitalmarktnahen Beitragsanlage entscheiden, ob die Versicherungsgesellschaft die Anlage fr Sie bernehmen sollen oder Sie mit Hilfe von Fonds doch lieber selbst aktiv werden.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'5',NULL,NULL,NULL,NULL),(10,'Betriebliche Altersvorsorge (bAV)','betriebliche-altersvorsorge-bav',NULL,'2018-01-10 17:12:26','2018-01-11 00:16:04',1,0,'Bei der betrieblichen Alstersvorsorge (bAV) handelt es sich um eine staatlich gefrderte Form der Altersvorsorge.\nIm Gegensatz zur Riesterrente erfolgt die Frderung jedoch nicht in Form eines bestimmten Betrags, der von staatlicher Seite in den Vertrag eingezahlt wird, sondern es handelt sich um eine Mglichkeit Steuern und Sozialversicherungsbeitrge zu sparen und so fr die eigene Rente zu nutzen.\n\nAuch hier gibt es natrlich vorgegebene Grenzen der staatlichen Frderung. Sie knnen von Ihrem Bruttoeinkommen bis zu 254,-  steuer- und sozialversicherungsfrei und nochmal 150,-  steuerfrei fr Ihre persnliche Altersvorsorge nutzen. Somit ergibt sich ein maximaler Vorsorgebeitrag von 404,- .\n\nDer Clou liegt darin, dass Ihnen durch die Steuer- und Sozialversicherungsfreiheit nur ein Bruchteil dieses Beitrags tatschlich im Portemonaille fehlt.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'5',NULL,NULL,NULL,NULL),(11,'Vermgenswirksame Leistungen','vermogenswirksame-leistungen',NULL,'2018-01-10 17:12:42','2018-01-11 01:13:39',1,0,'<h3>VWL Sparvertrag</h3>\n<br>\n<h4>Habe ich Anspruch auf vermgenswirksame Leistungen?</h4>\n<br>\nOb und vor Allem in welcher Hhe Sie Anspruch auf vermgenswirksame Leistungen (VWL) haben, knnen Sie entweder Ihrem Arbeitsvertrag, dem fr Sie geltenden Tarifvertrag oder Ihrer Betriebsvereinbarung entnehmen. Und selbst wenn Sie keinen zugesicherten Anspruch darauf haben, kann sich Ihr Arbeitgeber dennoch dazu entschlieen Ihnen diese Leistung zu gewhren.\n<br><br>\n<h4>Wie kann ich meine VWL anlegen?</h4>\n<br>\nDie VWL ist ein Gehaltsbestandteil, der vom Arbeitgeber gezahlt wird, wenn sich der Arbeitnehmer dazu entschliet mindestens in gleicher Hhe einen Altersvorsorge-Sparplan abzuschlieen.\n<br><br>\nHierzu stehen verschiedene Mglichkeiten zur Verfgung:\n<br><br>\n Private Rentenversicherung\n Betriebliche Altersvorsorge\n Riester Rente\n Bausparvertrag\n Investmentdepot\n<br>\nLassen Sie sich zu den Vor- und Nachteilen dieser Lsungen beraten','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'5',NULL,NULL,NULL,NULL),(12,'Riester-Rente','riester-rente',NULL,'2018-01-10 17:14:07','2018-01-11 01:17:54',1,0,'Bei der Riester Rente handelt es sich um eine staatlich gefrderte Altersvorsorgelsung. Die staatliche Frderung beruht auf einer jhrlichen Zulage, die der Staat direkt in Ihren Versicherungsvertrag einzahlt, wenn Sie bestimmte Kriterien erfllt haben. Zustzlich kann es sein, dass Sie auch noch von steuerlichen Vorteilen profitieren knnen, die somit Ihre eigene Belastung fr Ihren Rentenversicherungsvertrag reduzieren.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'5',NULL,NULL,NULL,NULL),(13,'Rrup-Rente','rurup-rente',NULL,'2018-01-10 17:14:20','2018-01-11 01:19:39',1,0,'Wer kennt das nicht  ein verschttetes Glas Rotwein auf dem Teppich von Freunden, ein unachtsamer Schritt auf den Fahrradweg, der Fahrradfahrer muss ausweichen und strzt unglcklich\n<br><br>\nEs gibt unzhlige Beispiele  ein kleines Missgeschick kann jedem mal passieren. Sie aber haften fr den Schaden in voller Hhe  deshalb ist der richtige Haftpflicht-Schutz ein absolutes Muss!','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'5',NULL,NULL,NULL,NULL),(14,'Haftpflichtversicherung','haftpflichtversicherung',NULL,'2018-01-10 17:16:22','2018-01-11 01:21:01',1,0,'Wer kennt das nicht  ein verschttetes Glas Rotwein auf dem Teppich von Freunden, ein unachtsamer Schritt auf den Fahrradweg, der Fahrradfahrer muss ausweichen und strzt unglcklich\n<br>\nEs gibt unzhlige Beispiele  ein kleines Missgeschick kann jedem mal passieren. Sie aber haften fr den Schaden in voller Hhe  deshalb ist der richtige Haftpflicht-Schutz ein absolutes Muss!','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6',NULL,NULL,NULL,NULL),(15,'Hausratversicherung','hausratversicherung',NULL,'2018-01-10 17:16:34','2018-01-11 01:22:03',1,0,'Ihre vier Wnde sind Ihr Zuhause. Der Ort, an dem Sie sich erholen, mit Ihrer Familie zusammen sind, Kinder groziehen und Freunde treffen. Ihr Zuhause haben sie liebevoll eingerichtet, Wnde, Decken und Fubden mit viel Arbeit und Geld individuell gestaltet. Und endlich ist alles so, dass Sie Ihr Heim mit niemandem tauschen mchten.\n<br><br>\nWer sein Hab und Gut vor alltglichen Gefahren schtzen mchte, tut dies mit einer Hausratversicherung, denn in Ihrem Haushalt stecken mehr Werte, als Ihnen bewusst ist.\n<br><br>\nEine gute Hausratversicherung lsst Sie damit nicht im Regen stehen. Ob Feuer, Leitungswasser, Blitz oder Einbruchdiebstahl: Mit einer auf Ihre Bedrfnisse angepassten Hausratversicherung erhalten Sie den Wiederbeschaffungspreis, also den Neuwert ihrer Haushaltsgegenstnde erstattet.\n<br><br>\nPersnliche Erinnerungen knnen nicht ersetzt werden, aber Ihre Versicherung hilft Ihnen, den Verlust auszugleichen, damit Sie sich schnell wieder wie Zuhause fhlen.\n<br><br>\nWer diese Schden aus eigener Tasche zahlen muss, ist wirklich nicht zu beneiden.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6',NULL,NULL,NULL,NULL),(16,'Hundehaftpflicht','hundehaftpflicht',NULL,'2018-01-10 17:16:44','2018-01-11 01:24:12',1,0,'In vielen Bundeslndern ist die Hundehalterhaftpflichtversicherung bereits Pflicht. Aber auch freiwillig versicherte Hundebesitzer wissen um das Risiko: Denn ist der Hund auch noch so folgsam  so haben die Vierbeiner doch manchmal ihren eigenen Kopf. Und schon ist es soweit: der Hund rennt auf die Strae und verursacht einen folgenschweren Autounfall. Sie als Hundehalter mssen fr den Schaden aufkommen. Aber auch eine kleine Keilerei mit einem anderen Hund auf der Spielwiese kann zu Verletzungen fhren die rztlich behandelt werden mssen. Die dafr entstehenden Kosten mssen Sie in voller Hhe bezahlen.\n<br><br>\nEine Hundehalterhaftpflichtversicherung bernimmt nicht nur diese Kosten, sondern wehrt im Zweifel (auch gerichtlich) unberechtigte Forderungen gegen Sie ab.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6',NULL,NULL,NULL,NULL),(17,'Reiseversicherung','reiseversicherung',NULL,'2018-01-10 17:17:01','2018-01-11 01:24:57',1,0,'Der Bereich und der Bedarf an Reiseversicherungen ist sehr breit gefchert. Egal ob Sie Ihre Urlaubsreise, den AuPair oder Travel&Work Auslandsaufenthalt, den Besuch eines auslndischen Gastes oder Ihre berufliche Auslandsentsendung absichern mchten. Stellen Sie sicher fr Ihre Gesundheit die richtige Wahl getroffen zu haben.\n<br><br>\nWenn Sie als gesetzlich Versicherter sicher sein wollen, die bestmgliche Gesundheitsversorgung zu erhalten, mssen Sie sich selbst darum kmmern, Ihre Leistungen Ihren Ansprchen entsprechend zu ergnzen.\n<br><br>\nWir helfen Ihnen bei der Wahl der richtigen Lsung.','',NULL,NULL,NULL,0.00,0.00,0.00,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'6',NULL,NULL,NULL,NULL);

