#
# Structure for table "term"
#

CREATE TABLE `term` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Unique number assigned to each term',
  `name` varchar(255) DEFAULT NULL COMMENT 'The name of the term',
  `status` smallint(1) DEFAULT '1',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='Terms are items of a taxonomy used to classify objects';

#
# Data for table "term"
#

INSERT INTO `term` VALUES (1,'Uncategorized',1),(2,'Versicherung',1),(3,'Gesundheit & Pflege',1),(4,'Arbeitskraft und Invaliditt',1),(5,'Altersvorsorge und Vermgen',1),(6,'Sach & Vermgenssicherung',1);

#
# Structure for table "term_taxonomy"
#

CREATE TABLE `term_taxonomy` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT 'Unique number assigned to each row of the table',
  `term_id` int(11) DEFAULT NULL COMMENT 'The ID of the related term. (Reference to the wp_terms table.)',
  `name` varchar(255) DEFAULT NULL COMMENT 'Title or custom heading for this taxonomy',
  `title` varchar(255) DEFAULT NULL,
  `description` text COMMENT 'description of the term in this taxonomy',
  `icon` varchar(100) DEFAULT NULL,
  `parent` int(11) DEFAULT NULL COMMENT 'Parent category',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=utf8 COMMENT='This table groups terms in categories';

